import React from "react";
import Carousel from "react-bootstrap/Carousel";

const images = [
  "/assets/images/slider/ISIF 2024-45.jpg",
  "/assets/images/slider/ISIF 2024-74.jpg",
  "/assets/images/slider/ISIF 2024-89.jpg",
  "/assets/images/slider/ISIF 2024-253.jpg",
  "/assets/images/slider/ISIF 2024-294.jpg",
  "/assets/images/slider/ISIF 2024-45.jpg",
  "/assets/images/background/img3.WebP",
];

const ImageSlider = () => {
  return (
    <div style={{ maxWidth: "600px", margin: "0 auto", paddingBottom: "2rem" }}>
      <Carousel fade={true} interval={2000}>
        {images.map((src, index) => (
          <Carousel.Item key={index}>
            <img
              className="d-block w-100 rounded"
              src={src}
              alt={`Slide ${index + 1}`}
              style={{ height: "250px", objectFit: "cover" }}
            />
          </Carousel.Item>
        ))}
      </Carousel>
    </div>
  );
};

export default ImageSlider;
